	          <ImageCheckBox name="netflix" enabled={this.state.netflix} onClick={(e) => this.setState({netflix:!this.state.netflix})} />
			  <ImageCheckBox name="netflix" enabled={this.state.netflix} onClick={(e) => this.setState({netflix:!this.state.netflix})} />
              
            </div>
            <input type="submit" value="Save" style={{marginLeft: "45vh", marginRight: "45vh", marginTop: "5vh"}} />
          </div>
        </div>
    );
  }
}
